import React from 'react';
import fire from '../Config/Config';
import '../css/login.css';
//import img1 from './assets/images/login.jpg';
import img2 from '.';
import '../css/animation.css';

 class Login extends React.Component{
    constructor(props){
        super(props);
        this.state={
            email:'',password:'',formTitle:'login',loginBtn:true
        }
    }
    handleText=e=>{
        this.setState({
            email:e.target.value,
            password:e.target.value
        })
    }

Login(){
    const email = document.querySelector("#email").value;
    const password= document.querySelector("#password").value;
    fire.auth().signInWithEmailAndPassword(email,password)
    .then((u)=>{
        console.log("Scess");
    })
    .catch((err)=>{
        console.log("Error"+ err.toString());
    })
}
signUp(){
    const email = document.querySelector("#email").value;
    const password= document.querySelector("#password").value;
    fire.auth().createUserWithEmailAndPassword(email,password)
    .then((u)=>{
        console.log("Scess");
    })
    .catch((err)=>{
        console.log("Error"+ err.toString());
    })
}
    render(){
        return(
            <div  className="d-flex align-items-center min-vh-100 py-3 py-md-0">
    <div  className="container">
      <div  className="card login-card">
        <div  className="row no-gutters">
          <div  className="col-md-5">
         
            <img src="assets/images/travel.svg" alt=""/>
          </div>
          <div  className="col-md-7">
            <div  className="card-body">
              <div  className="brand-wrapper">
                <img src="assets/images/logo.svg" alt="logo"  className="logo"/>
              </div>
              <p   className="login-card-description">Sign into your account</p>
              <form action="#!">
                  <div  className="form-group">
                    <label for="email"  className="sr-only">Email</label>
                    <input id="email" type="email" name="email"   className="form-control" placeholder="Enter Email" onChange={this.handleText}/>
                  </div>
                  <div  className="form-group mb-4">
                    <label for="password"  className="sr-only">Password</label>
                    <input type="password" name="password" id="password"  className="form-control" placeholder="***********"/>
                  </div>
                  <button style={{margin:"10px"}}  className="btn btn-block login-btn mb-4" onClick={this.Login}>Login</button>
                </form>
                <a href="/ForgotPassword"  className="forgot-password-link">Forgot password?</a>
                <p  className="login-card-footer-text">Don't have an account? <a href="/Signup"  className="text-reset">Register here</a></p>
                <nav  className="login-card-footer-nav">
                  <a href="#!">Terms of use.</a>
                  <a href="#!">Privacy policy</a>
                </nav>

          </div>
        </div>
      </div>
      </div>
  </div>
      

            {/*<div   className="form_block">
                <div id="title">{this.state.formTitle}</div>
                <div   className="body">
                    <form>
                        <input type="text"
                        value={this.state.email}
                        onChange={this.handleChange}
                        name="email"/>
                         <input type="password"
                        value={this.state.password}
                        onChange={this.handleChange}
                        name="password"/>
                        <input type="submit"   className="loginBtn" value="enter"/>
                    </form>
                </div>
		</div>*/}</div>

        );
    }
}
export default Login;
